import React, { Component } from "react";

class Mouse extends Component {
  state = {
    base: [
      {
        height: "70px",
        width: "70px",
        borderRadius: 300,
        border: "2px solid red",
        position: "absolute"
      }
    ]
  };

  render() {
    const absol = color => {
      let abs;
      return (abs = color);
    };
    let { base } = this.state;

    return (
      <div>
        <div>
          <div className="circle" style={base[0]}></div>
        </div>
      </div>
    );
  }
}

export default Mouse;
